  REGI02_Box6EN,
  REGI02_Box6DE,
  REGI02_Box6TH,
} from "../Data/DataLanguage";

import {
  IconButton,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Input,
